import axios from "axios";

export const addGame = (plot) => {
  var plotString = JSON.stringify(plot);

  axios
    .post("http://localhost:8080/api/games", {
      name: "The Stone Island",
      description: "The Island is full of statues",
      authorId: 1,
      tags: "mystery, horror",
      plot: plotString,
    })
    .then((response) => {
      console.log(response);
    })
    .catch((error) => {
      console.log(error);
    });
};
